import lift from './res/girl-lift.png'
import sky from './res/sky.png'
import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import React from 'react';
import { HeroSection } from './HeroSection';
import InfoCards from './InfoCards';
import land from './land.png';
import moon from "./moon.png";
import girl from './girl.png';
import tree1 from './tree1.png';
import tree2 from './tree2.png';

const url = (name, wrap = false) =>
  `${wrap ? 'url(' : ''}https://awv3node-homepage.surge.sh/build/assets/${name}.svg${wrap ? ')' : ''}`
function App() {

  const internships = [
    {
      title: "Goldman Sachs",
      body: "This is the first paragraph for Goldman Sachs internship.",
      image: "goldman_sachs_image_url"
    },
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];
  const projects1 = [
    {
      title: "Goldman Sachs",
      body: "This is the first paragraph for Goldman Sachs internship.",
      image: "goldman_sachs_image_url"
    },
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];

  const projects2 = [
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    },{
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];

  const alignCenter = { display: 'flex', alignItems: 'center' }

  return (
    <div className="flex-container">
      <Parallax pages={4}>
        {/* // page 1 */}
        <div className="flex-item1">
          <ParallaxLayer
            offset={0}
            speed={0}
            factor={3}
            style={{
              backgroundImage: `url(${sky})`,
              backgroundSize: 'cover',
            }}
          ></ParallaxLayer>
        </div>

        {/* <ParallaxLayer sticky={{ start: 0.3, end: 4 } }>
          <div className= "card" >
            <img src={girl} style={{marginLeft:'20%', maxWidth: '100%', height: 'auto' }} />
          </div>
        </ParallaxLayer> */}

        <ParallaxLayer offset={0.3} speed={-1}>
        <div className= "card" >
            <img src={girl} style={{marginLeft:'20%', maxWidth: '100%', height: 'auto' }} />
          </div>
        </ParallaxLayer>   


        <ParallaxLayer
          offset={0.35}
          speed={0.1}
          >
          <div style={{ display: 'inline-block', marginLeft:'45%'}}>
           <HeroSection/>
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={1}
          speed={0.1}
          >
          <div style={{ display: 'inline-block', marginLeft:'45%'}}>
            <div style={{ marginBottom: '30px' }}>
              <h1>Experience</h1>
              <InfoCards info = {internships}/>
            </div>
          </div>
        </ParallaxLayer>

        <ParallaxLayer
          offset={2}
          speed={0.1}
          >
          <div style={{ display: 'inline-block', marginLeft:'45%'}}>
            <div style={{ marginBottom: '20px' }}>
            <h1>Projects</h1>
              <InfoCards info ={projects1}/>
            </div>
            <InfoCards info = {projects2}/>
          </div>
        </ParallaxLayer>

        <ParallaxLayer offset={2.6} speed={0.4} >
          <img src={tree1} style={{ display: 'block', width: '10%', marginLeft: '25%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0} speed={0.8} style={{ opacity: 0.2 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '55%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '15%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0.75} speed={0.5} style={{ opacity: 0.1 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '70%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '40%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0} speed={0.2} style={{ opacity: 0.2 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '10%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '75%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0.6} speed={-0.1} style={{ opacity: 0.4 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '60%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '25%', marginLeft: '30%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '80%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={1.6} speed={0.4} style={{ opacity: 0.6 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '25%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '15%', marginLeft: '75%' }} />
        </ParallaxLayer>


        {/* <div className="flex-item2">
          <ParallaxLayer
            sticky={sticky}
            offset={0}
            speed={1}
            factor={1}
            style={{ textAlign: 'left', flex: 2 }}
          >
            <div className="card">
              <img src={lift} className="sticky-image" style={{ maxWidth: '100%', height: 'auto' }} />
            </div>
          </ParallaxLayer>
        </div> */}
        {/* // page 2 */}
        {/* <ParallaxLayer
          offset={2}
          speed={0}
          factor={1}
          style={{
            backgroundImage: `url(${land})`,
            backgroundSize: 'cover',
          }}
        ></ParallaxLayer> */}

        {/* // page 3 */}
        {/* <ParallaxLayer
          offset={2}
          speed={1}
          factor={1}
          style={{
            backgroundImage: `url(${sky})`,
            backgroundSize: 'cover',
          }}
        ></ParallaxLayer> */}

      </Parallax>
    </div>
  );
}

export default App;
